import React, { createRef } from 'react';
import { Map, Marker, Popup, TileLayer } from 'react-leaflet'

class LatLongMap extends React.Component {
	constructor(props) {
		super(props)
	  	this.state = {
	    	center: { x: 0, y: 0, zoom: 13 },  
	    	marker: null
	    }
	}

	mapRef = createRef()

	render() {
    	const marker = this.state.marker != null ? (
      		<Marker position={this.state.marker.lat, this.state.marker.lon}>
        		<Popup>You are @ {this.state.marker.lat}, {this.state.marker.lon}</Popup>
      		</Marker>
    	) : null

    	return (
      		<Map
        		center={[this.state.center.x, this.state.center.y]}
        		length={4}
        		ref={this.mapRef}
        		zoom={this.state.center}>
       		<TileLayer
          		attribution='&amp;copy <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
          		url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        	/>
        	{marker}
      		</Map>
    	)
  	}
}

function handleClick(num, lat, lon) {
	return () => {
		console.log("You clicked item " + num + ": " + lat + ", " + lon)
		console.log(this)
	}
}

const LatLongList = ({latLongs}) => {
	var num = -1;
	return <table>
		<tbody>
			{latLongs.map(latLong => {
				num = num + 1
				var lat = latLong.latitude
				var lon = latLong.longitude
				return <tr key={lat + "," + lon}>
					<td onClick={handleClick(num, lat, lon)}>{lat + ", " + lon}</td>
				</tr>
				}
			)}
		</tbody>
    </table>
}

const LatLongsComponent = ({latLongs}) => (
    <table>
		<tbody>
			<tr>
				<td><LatLongList latLongs={latLongs}/></td>
				<td><LatLongMap /></td>
			</tr>
		</tbody>
    </table>
  )


export default LatLongsComponent;
